import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './AdminDashboard.css';

const AdminDashboard = () => {
    const [vendors, setVendors] = useState([]);
    const [formData, setFormData] = useState({
        name: '',
        vendorId: '',
        address: '',
        licenseNumber: ''
    });
    const [editId, setEditId] = useState(null);
    const [error, setError] = useState('');

    useEffect(() => {
        fetchVendors();
    }, []);

    const fetchVendors = async () => {
        try {
            const response = await axios.get('http://localhost:5000/api/vendors');
            setVendors(response.data);
        } catch (err) {
            setError('Failed to fetch vendors');
            console.error(err);
        }
    };

    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            if (editId) {
                await axios.put(`http://localhost:5000/api/vendors/${editId}`, formData);
            } else {
                await axios.post('http://localhost:5000/api/vendors', formData);
            }
            setFormData({ name: '', vendorId: '', address: '', licenseNumber: '' });
            setEditId(null);
            fetchVendors();
        } catch (err) {
            setError('Operation failed');
            console.error(err);
        }
    };

    const handleEdit = (vendor) => {
        setFormData(vendor);
        setEditId(vendor._id);
    };

    const handleDelete = async (id) => {
        try {
            await axios.delete(`http://localhost:5000/api/vendors/${id}`);
            fetchVendors();
        } catch (err) {
            setError('Failed to delete vendor');
            console.error(err);
        }
    };

    return (
        <div className="admin-dashboard">
            <h2>Vendor Management</h2>
            {error && <div className="error">{error}</div>}

            <form onSubmit={handleSubmit} className="vendor-form">
                <input
                    type="text"
                    name="name"
                    placeholder="Vendor Name"
                    value={formData.name}
                    onChange={handleChange}
                    required
                />
                <input
                    type="text"
                    name="vendorId"
                    placeholder="Vendor ID"
                    value={formData.vendorId}
                    onChange={handleChange}
                    required
                />
                <input
                    type="text"
                    name="address"
                    placeholder="Address"
                    value={formData.address}
                    onChange={handleChange}
                    required
                />
                <input
                    type="text"
                    name="licenseNumber"
                    placeholder="License Number"
                    value={formData.licenseNumber}
                    onChange={handleChange}
                    required
                />
                <button type="submit">
                    {editId ? 'Update Vendor' : 'Add Vendor'}
                </button>
                {editId && (
                    <button type="button" onClick={() => {
                        setFormData({ name: '', vendorId: '', address: '', licenseNumber: '' });
                        setEditId(null);
                    }}>
                        Cancel
                    </button>
                )}
            </form>

            <div className="vendor-table">
                <table>
                    <thead>
                        <tr>
                            <th>#</th>
                            <th>Vendor Name</th>
                            <th>Vendor ID</th>
                            <th>Address</th>
                            <th>License Number</th>
                            <th>Actions</th>
                        </tr>
                    </thead>
                    <tbody>
                        {vendors.map((vendor, index) => (
                            <tr key={vendor._id}>
                                <td>{index + 1}</td>
                                <td>{vendor.name}</td>
                                <td>{vendor.vendorId}</td>
                                <td>{vendor.address}</td>
                                <td>{vendor.licenseNumber}</td>
                                <td>
                                    <button onClick={() => handleEdit(vendor)}>Edit</button>
                                    <button onClick={() => handleDelete(vendor._id)}>Delete</button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
};

export default AdminDashboard;
